// </StyledMenu>

const Menu = ({ children, open }) => {
  const renderItems = children.map((x,i) => 
    <div className="divv" key={i}>
      {x}
    </div>
  )

  return (
    <NormalNavbar>
      { 
        open ? <StyledMenu>{renderItems}</StyledMenu> : renderItems
      }
    </NormalNavbar>
  )
}
export default Menu
